const Menu = () => {

	const items = [
		{
			id:1,
			name: "Beef Burger",
			type: "Burger",
			price: 15,
			img: ""
		},
		{
			id:1,
			name: "Spaghetti Bolognese",
			type: "Noodles",
			price: 20,
			img: ""
		},
		{
			id:1,
			name: "Beefsteak",
			type: "Steak",
			price: 30,
			img: ""
		},
		{
			id:1,
			name: "French Fries",
			type: "Snack",
			price: 10,
			img: ""
		}
	]

	return (<>
		<div class="flex justify-between">
		<span>a</span>
			<h1>Menu</h1>
		<span>a</span>
		{ items.map(v => (
			<div>
				<ul>
					<li>{v.name}</li>
					<li>{v.type}</li>
					<li>{v.price}</li>
				</ul>
			</div>
		)) }
		</div>
	</>);
}
 
export default Menu;
